<head>
    <style>
        /* style placeholder */
/*#######################*/
:root {
    /* define global variables */
    /* official SEG colours*/   
    --primary-blue: rgba(46,149,222,1.0);
    --primary-navy: rgba(10,52,94,1.0);
    --primary-white: rgba(255,255,255,1.0);
    --support-dark-grey: rgba(143,143,143,1.0);
    --support-light-grey: rgba(198,198,198,1.0);
    --support-off-white: rgba(246,241,230,1.0);
    --accent-blue: rgba(17,175,219,1.0);
    --accent-orange: rgba(243,159,33,1.0);
    --accent-coral: rgba(239,112,148,1.0);

    /*additional colours*/
    --blue-ish-grey: rgba(245, 244, 250, 1.0);
    --select-box-grey: rgba(227, 227, 227, 1.0);
    --selected-blue: rgba(203, 230, 246, 1.0);
    --text-almost-black: rgba(62, 61, 73, 1.0);
    --bottom-navbar-height: 13vh;
    --very-light-grey: rgba(240,240,240,1.0);
    --results-green-dark: rgba(60,179,113,1.0);
    --results-green-light: rgba(152,251,152,1.0);
    --results-red-dark: rgba(220,20,60,1.0);
    --results-red-light: rgba(239,200,200,1.0);
    --results-blue-dark: rgba(46,149,222,1.0);
    --results-blue-light: rgba(240,248,255,1.0);
}

.global-wrapper div {
    /*margin-top: 3%;*/
    /*margin-bottom: 3%;*/
    max-width: 100%;
}

.global-wrapper p {
    max-width: 70%;
    color: var(--primary-navy);
}

.html-preview {
    border: 1px solid var(--support-light-grey);
    margin-top: 5px;
    margin-bottom: 5px;
}

.cost-table {
    max-width: 50%;
    border-collapse: collapse;
    margin-top: 10px;
    margin-bottom: 10px;
}

.details-table {
    max-width: 90%;
    border-collapse: collapse;
    margin-top: 10px;
    margin-bottom: 10px;
}

.details-table th, .details-table td, .cost-table th, .cost-table td{
    text-align: left;
    padding-top: 5px;
    padding-bottom: 5px;
    padding-right: 10px;
}

.results-table caption {
    caption-side: top;
    font-weight: bold;
}

.results-table {
    max-width: 90%;
    border-collapse: collapse;
    margin-top: 15px;
    margin-bottom: 15px;
}

.results-table table {
    min-width: 25%;
    margin-top: 15px;
    margin-bottom: 15px;
}

.results-table th, .results-table td {
    border: 2px solid var(--support-light-grey);
    text-align: left;
    padding: 5px;
}


/*cart styling start*/

.waterfall-chart {
    height: 400px;
    min-width: 30%;
    border: 1px solid var(--support-light-grey);
    position: relative;
}
.waterfall-bar-labels {
    height: 150px;
    min-width: 30%;
    position: relative;
}

.waterfall-label {
    position: absolute;
    transform-origin: bottom right;
    transform: rotate(-50deg);
    white-space: nowrap;
    text-align: right;
    direction: rtl;
}

.waterfall-data-label {
    position: absolute;
    text-align: center;
}

.waterfall-bar-up-1 {
    position: absolute;
    background-color: var(--primary-blue);
    border-radius: 10px;
    transition: height 2s ease;
}

.waterfall-bar-down-1 {
    position: absolute;
    background-color: var(--support-light-grey);
    border-radius: 10px;
    transition: height 2s ease;
}

.waterfall-bar-down-2 {
    position: absolute;
    background-color: var(--accent-coral);
    border-radius: 10px;
    transition: height 2s ease;
}

.waterfall-bar-total-1 {
    position: absolute;
    background-color:var(--primary-navy);
    border-radius: 10px 10px 0px 0px;
    transition: height 2s ease;
}

.waterfall-bar-total-2 {
    position: absolute;
    background-color:var(--primary-blue);
    border-radius: 10px 10px 0px 0px;
    transition: height 2s ease;
}

.waterfall-bar-total-3 {
    position: absolute;
    background-color:var(--accent-coral);
    border-radius: 10px 10px 0px 0px;
    transition: height 2s ease;
}

/*cart styling end*/


/* Styling for the popup */
.popup {
    display: none;
    max-width: 500px;
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    padding: 30px;
    background-color: white;
    border: 1px solid var(--support-light-grey);
    box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.3);
    z-index: 1000;
}

.close-button {
    position: absolute;
    top: 10px;
    right: 10px;
    background-color: transparent;
    border: none;
    cursor: pointer;
}

.overlay {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    z-index: 900;
}

.button-container {
    display: flex; /* Use flex display to make the buttons sit next to each other */
    justify-content: space-between; /* Space them evenly within the container */
}


.input-container {
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-bottom: 5px;
}

label {
    display: block;
    margin-bottom: 5px;
}

input[type="number"],
input[type="checkbox"] {
    padding: 5px;
    border: 1px solid var(--support-light-grey);
    border-radius: 4px;
}

input[type="text"],
input[type="email"],
input[type="password"] {
    padding: 5px;
    margin-bottom: 5px;
    margin-top: 5px;
    border: 1px solid var(--support-light-grey);
    border-radius: 4px;
}

/*loader styling*/
.loader {
    margin: auto;
    border: 16px solid var(--support-light-grey); /* Light grey */
    border-top: 16px solid var(--primary-blue); /* Blue */
    border-radius: 50%;
    width: 100px;
    height: 100px;
    animation: spin 2s linear infinite;
}

@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}

/*user warning*/
.userWarning {
    display: none;
    color: red;
}

</head>

<body>
    <div id="divGlobalWrapper" class="global-wrapper">   

        <div id="divSendCancel" style="display: none;">
            <strong>Click here to cancel this campaign:</strong>
            <button id="cancelSendButton" class="sqs-button-element--primary" onclick="cancelSend()">Cancel</button>
        </div>

        <div id="divCost" style="display: none;">
            <h4 id="costHeader"></h4>
            <table class="cost-table">
                <tr>
                    <th>Initial Validation:</th>
                    <td id="ctiv"></td>
                </tr>            
                <tr>
                    <th>Email Verification:</th>
                    <td id="ctev"></td>
                </tr>            
                <tr>
                    <th>Email Send:</th>
                    <td id="ctes"></td>
                </tr>            
                <tr>
                    <th>Total:</th>
                    <td id="cttl"></td>
                </tr>
            </table>            
        </div>

        <div id="divSubmitted" style="display: none;">
            <h4>Basic Details</h4>
            <table class="details-table">
                <tr>
                    <th>Name:</th>
                    <td id="sendName"></td>
                </tr>
                <tr>
                    <th>Description:</th>
                    <td id="sendDesc"></td>
                </tr>
                <tr>
                    <th>Subject Line:</th>
                    <td id="sendSubj"></td>
                </tr>
                <tr>
                    <th>Send From:</th>
                    <td id="sendFrom"></td>
                </tr>
                <tr>
                    <th>Send Time:</th>
                    <td id="sendTime"></td>
                </tr>
                <tr>
                    <th>Starting Recipients:</th>
                    <td id="sendRecp"></td>
                </tr>
                <tr>
                    <th>HTML Content:</th>
                </tr>
            </table>
                <div id="sendHTML" class="html-preview"></div>
        </div>

        <div id="divSendResults" style="display: none;">
            <h4>Send Results</h4>
            <button id="reloadResults" class="sqs-button-element--primary" onclick="getResults()">Reload</button>
            <button id="downloadResults" class="sqs-button-element--primary" onclick="downloadDetail()">Download Detailed CSV</button>
            <p id="downloadResultsBlurb" style="display: none;"></p>
            <br>
            <br>
            <h4>Campaign Waterfall</h4>
            <div id="chartContainer" class="waterfall-chart"></div>
            <div id="chartLabels" class="waterfall-bar-labels"></div>
            <div style="display: none;">
                <h4>Result table</h4>
                <div id="sendResultsContent" class="results-table"></div>
            </div>
        </div>

    </div>
    <!-- Popup and overlay elements -->
    <div class="overlay" id="overlay"></div>
    <div class="popup" id="popup">
     <div id="popupContent">
         <!-- Content will be populated here -->
     </div>
    </div>
